import axios from "axios";
import {Formik, Form, Field, ErrorMessage} from 'formik'
import { useEffect, useState } from "react";
import * as Yup from "yup"; 

function Login() {
  const [email, setEmail] = useState("");
  const [lozinka, setLozinka] = useState("");

  const login = () => {
    const data = { email: email, lozinka: lozinka};
    axios.post("http://localhost:3100/auth/login", data).then((response) => {
      console.log(response.data);
    })
  }

  return (
    <div className='dodavanjeGarderobe'>
    <Formik /*initialValues={initialValues} onSubmit={onSubmit} validationSchema={validationSchema}*/>
        <Form className="formContainer">
            <label> Email: </label>
            <Field  type="email" id="inputCreatePost" name="email" placeholder="Unesite email" />
            <label> Lozinka: </label>
            <Field  type="password" id="inputCreatePost" name="lozinka" placeholder="Unesite lozinku" />
            <button type="submit"> Dodaj </button>
        </Form>
    </Formik>
</div>
  )
}

export default Login
